import React, { Component } from 'react';
import ChatroomView from './ChatroomView';

const ChatroomList = (chatrooms) => {
  return (
    <ul>
      {chatrooms.map(room => (
        <li key={room.name}>
          <ChatroomView room={room} />
        </li>
      ))}
    </ul>
  );
};

export default ChatroomList;
